import React from 'react';
import '../Components Styles/Cart.css';

const CartCard = ({val,index}) => {
  return (
    <div id="caryCardContainer">
         <table>
              <tr>
                   <th>{index+1}</th>
                   <th>{val.strMeal}</th>
                   <th>{val.qty}</th>
                   <th>{val.Price}</th>
                   <th>{val.Price * val.qty}</th>
              </tr>
         </table>
    </div>
  )
}

export default CartCard
